import React, { useState } from 'react';


const App=()=>
{
    const State = useState();
    const[count,setcount]=useState(0);
    const incno=()=>
    {
        setcount(count+1);
    };
return (
    <>
     <h1>{count}</h1>
     <button onClick={incno}>like</button>
    </>
);
}
export default App;
